package main

import (
	"fmt"
)

func sumSubarrayMins(A []int) int {
	ln, mp, stack, cur, peek, sum := len(A), make(map[int]int), make([]int, 0), 0, 0, 0

	for i := 0; i < ln; i++ {
		for len(stack) > 0 {

			peek := len(stack) - 1
			if A[i] > A[stack[peek]] {
				break
			}

			if peek == 0 {
				stack = []int{}
				break
			}
			stack = stack[:peek]
		}

		if len(stack)-1 < 0 {
			cur = (i + 1) * A[i]
		} else {
			peek = stack[len(stack)-1]
			cur = mp[peek] + (i-peek)*A[i]
		}

		cur %= 1000000007
		stack = append(stack, i)
		mp[i] = cur
		sum += cur
		sum %= 1000000007
	}

	return sum
}

